import { Route } from 'react-router-dom';
import './App.css';
import Bar from './components/Bar';
import Forum from './components/Forum';
import Home from './components/Home';
function App() {
  return (
    <div className="App">

      <Bar/>
      <Route path='/' component={Home}/>
      <Route path='/blog' component={Forum}/>

    </div>
  );
}

export default App;
